import "./css.style";

function App() {
	// the content in the () is called JSX
	// no "class" in JS, only "className"
	// you can only return one element, in this case is <header>
	return (
		<header className="header">
			<div className="logo">
				<img src="logo.png" alt="Today I Learned" />
				<h1>Hello world!</h1>
			</div>
			<button className="btn btn-large btn-share">Share a fact</button>
		</header>
	);
}

export default App;
